        return new Source("{% extends 'base.html.twig' %}

{% block title %}Hello LoginController!{% endblock %}

{% block body %}
    {% if error %}
        <div>{{ error.messageKey|trans(error.messageData, 'security') }}</div>
    {% endif %}
    <div class=\"container\">
        <h1>Inicia sesión para continuar</h1>
        <form action=\"{{ path('app_login') }}\" method=\"post\">
            <div class=\"form-group col-sm-3\">
                <label for=\"username\">Nombre de usuario:</label>
                <input type=\"text\" class=\"form-control\" id=\"username\" name=\"_username\" value=\"{{ last_username }}\"/><br>
            </div>
            <div class=\"form-group col-sm-3\">
                <label for=\"password\">Contraseña:</label>
                <input type=\"password\" class=\"form-control\" id=\"password\" name=\"_password\"/>
            </div>
            <br>
            <button type=\"submit\" class=\"btn btn-primary\">Iniciar sesión</button>
            {% if error %}
                    <span class=\"error\">{{ error.messageKey|trans(error.messageData, 'security') }}</span>
            {% endif %}

            <p style=\"font-size: 12px; margin-top: 5px;\">¿No tienes cuenta?
                    <a href=\"{{ path( \"app_register\") }}\">Regístrate</a>
            </p>
        </form>
    </div>
{% endblock %}
